window.bookSummaryJSON = "<p>The Stalker:</p> <p>The first time I saw my little bird, I knew she belonged to me.</p> <p>She’s new to the city, all alone. She doesn’t know who I am, but I’ve been watching her. Stalking her in the shadows, keeping her safe. Killing anyone who threatens her.</p> <p>I’ve built a cage around her, luring her in. And when it’s time to reveal myself to her, she won’t be able to escape.</p> <p>In every way, she will be mine.</p> <p><i>His Perfect Darkness is a dark billionaire romance with intense, sensual themes.</i></p>"; 
